export default class extends React.Component {
    render(){
        return <div>
         <h1>Hola Mundo!</h1>
        <p>Bienvenidos al curso</p>
        <img src="/public/static/BioEnergeticaISOLOGO.png" />
    <style jsx>{`
    h1 { color: red;}
    div :global(p) {color: green;}
    img { max-width: 80%;
        display: block;
        margin: 0 auto;
    }

    `}</style>
    <style jsx global>{`
    body {
        background: white;
    }
    `}</style>
    </div>
    }
}
